import React from 'react'
import style from './cart.module.scss'
import clsx from 'clsx'

export default function Cart() {
  return (
    <div className={clsx(style.cartMain)}>
      <h1 className={clsx(style.heading)}>check out</h1>
    </div>
  )
}
